import React from "react";
import { NavLink } from "react-router-dom";

class HomeBody extends React.Component {
  render() {
    return (
      <section className="py-5 ms-5">
        <div>
          <div className="col-lg-6 col-md-8 mu-10">
            <h1>Talk to professionals working in your dream career</h1>
            <p className="lead text-muted"></p>
            <p>
              <NavLink to="/sign=up" className="btn btn-warning my-2">
                Connect your first call for free! >
              </NavLink>
            </p>
          </div>
        </div>
      </section>
    );
  }
}

export default HomeBody;
